mapper.select:
select COUNT(*) as number,resultss.lg_addtime from (select count(*) as zss,lg_addtime,DATE_FORMAT(lg_addtime, '%m%d') as day from qd_lg_power where lg_qd_id=#{id} and lg_ztc_id is not null GROUP BY lg_ztc_id) as resultss
WHERE #{findQdMessageModel.stopTime}>=resultss.lg_addtime and resultss.lg_addtime>=#{findQdMessageModel.startTime}
GROUP BY resultss.day ORDER BY resultss.lg_addtime DESC LIMIT #{findQdMessageModel.numberOfInitial},#{findQdMessageModel.numberOfBranches}

select COUNT(*) as number,resultss.lg_addtime from (select count(*) as zss,lg_addtime,DATE_FORMAT(lg_addtime, '%m%d') as day from qd_lg_power where lg_qd_id=#{qdId} and lg_ztc_id is not null GROUP BY lg_ztc_id) as resultss
WHERE #{findQdMessageModel.stopTime}>=resultss.lg_addtime and resultss.lg_addtime>=#{findQdMessageModel.startTime}
GROUP BY resultss.day ORDER BY resultss.lg_addtime DESC

select qb.lg_shop_uid,qb.qd_gm_pay,qb.qd_fb_time,qb.qd_sesame,qb.qd_loanpay,qb.qd_username,qb.qd_region,qb.qd_age,qb.qd_professional, qb.qd_often,qb.qd_social,qb.qd_plicy,qb.qd_assets,qb.qd_income,qb.qd_units,qb.qd_fund,qb.qd_time,qb.qd_qq,qb.qd_wechat,qb.qd_phone,qb.qd_sex from qd_basicmanager as qb WHERE (qb.lg_shop_uid IN ( SELECT qlp1.lg_shop_uid FROM qd_lg_power as qlp1 where qlp1.lg_phone=#{searchConditions.phone} and qb.lg_shop_uid=qlp1.lg_shop_uid ))
and ( qb.qd_username like concat(concat("%",#{searchConditions.searchBox}),"%") or qb.qd_phone like concat(concat("%",#{searchConditions.searchBox}),"%"))
and date(qb.qd_fb_time) between #{searchConditions.startTime} and #{searchConditions.stopTime}
order by qb.lg_shop_uid desc
LIMIT #{searchConditions.numberOfInitial},#{searchConditions.numberOfBranches}

select count(*) from qd_basicmanager as qb WHERE (qb.lg_shop_uid IN ( SELECT qlp1.lg_shop_uid FROM qd_lg_power as qlp1 where qlp1.lg_phone=#{searchConditions.phone} and qb.lg_shop_uid=qlp1.lg_shop_uid )) and qb.qd_region like concat(concat("%",#{searchConditions.city}),"%")
and (qb.qd_username like concat(concat("%",#{searchConditions.searchBox}),"%") or qb.qd_phone like concat(concat("%",#{searchConditions.searchBox}),"%"))
and date(qb.qd_fb_time) between #{searchConditions.startTime} and #{searchConditions.stopTime}
